  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains Brownfield Boundaries.
  Brownfields are defined by the Florida Department of Environmental Protection (FDEP)
  as abandoned, idled, or underused industrial and commercial facilities where expansion
  or redevelopment is complicated by real or perceived environmental contamination.
  The primary goals of Florida's Brownfields Redevelopment Act (Ch. 97-277, Laws of
  Florida, codified at ss. 376.77-.85, F.S.) are to reduce health and environmental
  hazards on existing commercial and industrial sites that are abandoned or underused
  due to these hazards and create financial and regulatory incentives to encourage
  redevelopment and voluntary cleanup of contaminated properties. A \"brownfield area\"
  means a contiguous area of one or more brownfield sites, some of which may not be
  contaminated, that has been designated as such by a local government resolution.
  Such areas may include all or portions of community redevelopment areas, enterprise
  zones, empowerment zones, other such designated economically deprived communities
  and areas, and Environmental Protection Agency (EPA) designated brownfield pilot
  projects. This layer provides a polygon representation of the boundaries of these
  designated Brownfield Areas in Florida. This is an update to the u00c2u00a0BROWNFIELD
  AREAS - April 2012\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
